import React from 'react'
import { Nav } from '../Componets/Navbar/Nav'
import { Footer } from '../Componets/Footer/Footer'
import { Cervices } from '../Componets/Services/Cervices'
import img from '../Componets/Images/tarun-ottur-K8oY2P8keoM-unsplash.jpg'


export const Contact = () => {
  return (
    <div><Nav></Nav>
    <Cervices pic={img}></Cervices>
    <Footer></Footer></div>
  )
}
